		"text": "Totally agree - Although I think there is teeny bits of learning and success in all failures and dead ends. It doesn't get you anywhere - but it is another thing off of your list of things tried. The list gets smaller... I'm putting it badly... hope that makes sense... #LTHEchat https://t.co/qrfkqdrKuJ"
